    initGraphCallback(data) {
        if (Util.checkResponse(data)) {
            if (data.responseCode == 0) {
                this.fromDateOptions = (data.resultData.dateList != null && data.resultData.dateList != undefined ? JSON.parse(data.resultData.dateList) : []);
                this.segmentOption = (data.resultData.segment != null && data.resultData.segment != undefined ? JSON.parse(data.resultData.segment) : []);
                this.mainOption = (data.resultData.graphType != null && data.resultData.graphType != undefined ? JSON.parse(data.resultData.graphType) : []);
                this.info = data.resultData.info;
                for (let i = 0; i < data.resultData.symbol.length; i++) {
                    var result = data.resultData.symbol[i][0];
                    this.symbolOptions.push({ key: result, value: result });
                }
                this.seriesOption = (data.resultData.series != null ? JSON.parse(data.resultData.series) : []);
                this.notesOption = (data.resultData.notes != null ? JSON.parse(data.resultData.notes) : []);
                if (this.graphType != survConst.IntegratedGraph.AVG) {
                    this.pvTypeOption = [{ key: 'Price', value: 'Price' }, { key: 'Volume', value: 'Volume' }];
                } else {
                    this.pvTypeOption = [{ key: 'Price', value: 'Price' }];
                }
                this.integratedGraphForm.controls["segment"].setValue({ key: "CM", value: "CM" });
                this.integratedGraphForm.controls["series"].setValue({ key: "EQ", value: "EQ" });
            } else {
                this.toastMessageService.showMessage(survConst.ERROR, data.responseMsg, survConst.ERROR);
            }
        }
    }

    disableDates(event) {
        this.reset();
        this.integratedGraphForm.get('toDate').clearValidators();
        this.integratedGraphForm.get('fromDate').clearValidators();
        this.integratedGraphForm.get('fromHistDate').clearValidators();
        this.integratedGraphForm.get('toHistDate').clearValidators();
        this.integratedGraphForm.get('fromHistDate').markAsUntouched(); 
        this.integratedGraphForm.get('toHistDate').markAsUntouched(); 
        this.integratedGraphForm.get('fromDate').markAsUntouched(); 
        this.integratedGraphForm.get('toDate').markAsUntouched(); 
        IntegratedGraphValueAxis.VALUEAXIS.forEach(element => {
                element.status=null;
        });
        IntegratedGraphStockGraph.STOCKGRAPH.forEach(element => {
            element.status=null;
        });
        if (event.value.value != survConst.IntegratedGraph.HIST) {
            this.integratedGraphForm.controls.toHistDate.disable();
            this.integratedGraphForm.controls.fromHistDate.disable();
            this.integratedGraphForm.controls.toDate.enable();
            this.integratedGraphForm.controls.fromDate.enable();
            this.integratedGraphForm.controls.toHistDate.setValue(null);
            this.integratedGraphForm.controls.fromHistDate.setValue(null);
            this.integratedGraphForm.controls.toDate.setValidators(Validators.required);
            this.integratedGraphForm.controls.fromDate.setValidators(Validators.required);

        } else {
            this.integratedGraphForm.controls.toDate.disable();
            this.integratedGraphForm.controls.fromDate.disable();
            this.integratedGraphForm.controls.toHistDate.enable();
            this.integratedGraphForm.controls.fromHistDate.enable();
            this.integratedGraphForm.controls.toDate.setValue(null);
            this.integratedGraphForm.controls.fromDate.setValue(null);
            this.integratedGraphForm.controls.fromHistDate.setValidators(Validators.required);
            this.integratedGraphForm.controls.toHistDate.setValidators(Validators.required);
        }
        this.integratedGraphForm.get('fromHistDate').updateValueAndValidity(); 
        this.integratedGraphForm.get('toHistDate').updateValueAndValidity(); 
        this.integratedGraphForm.get('fromDate').updateValueAndValidity(); 
        this.integratedGraphForm.get('toDate').updateValueAndValidity(); 

        if (event.value.value == survConst.IntegratedGraph.AVG) {
            this.pvTypeOption = [{ key: 'Price', value: 'Price' }];
        }else{
            this.pvTypeOption = [{ key: 'Price', value: 'Price' }, { key: 'Volume', value: 'Volume' }];
        }
        this.reset();
    }

