    insertEvemtTimeInGraphData() {     
        let isLastElement:boolean;       
        for(var tmp=0;tmp<this.graphNotes.length;tmp++) {                 
          var recFoundInd =  this.graphData.findIndex(innerele => innerele.date === this.graphNotes[tmp]['date']);
        // console.log(recFoundInd);
           if (recFoundInd == -1) {                             
               for(var i=0;i<this.graphData.length;i++) {
                  isLastElement = true;
                  let tempobj:any = {};
                   if(moment(this.graphNotes[tmp]['date']).isBefore(this.graphData[i]['date'])) {                   
                   
                        tempobj = {...this.graphData[i-1]};
                        console.log(i);        
                        isLastElement  =false;
                        tempobj.date = this.graphNotes[tmp]['date'];                                                        
                        this.graphData.splice(i,0,tempobj);                     
                        break;                   
                   }                          
               }
         
               if(isLastElement===true) {
                 let obj = this.graphData[this.graphData.length-1];
                 obj.date = this.graphNotes[tmp]['date'];
                 this.graphData.push(obj);
                 break; 
               }
           }
      }
      console.log( this.graphData);
    }
setGraphNotes() {
    let tmpGraphNotesArr: any = [];
    if(this.graphNotes.length > 0) {    
        let tmpGraphNotesData = [...this.graphNotes];
        let symbolName = this.graphName[this.graphName.length-1].key;
        let symbolNameSplit =   symbolName.split("-");
        let noOfSymFound = this.graphName.filter((ele)=>{
          let item = ele.key;
          let splitItem =   item.split("-");
          return splitItem[1] +"-"+splitItem[2]===symbolNameSplit[1]+"-"+symbolNameSplit[2];
       });
            let graphName;
            if(noOfSymFound.length==1) {
                graphName = this.integratedGraphConfig.marketReplayStockCh.panels["0"].stockGraphs.find((ele)=>{
                return ele.title===symbolName;
                }) 
            }
            else {
                graphName = this.integratedGraphConfig.marketReplayStockCh.panels["0"].graphs.find((ele)=>{
                    return ele.title===symbolNameSplit[0]+"-"+symbolNameSplit[1]+"-"+symbolNameSplit[2]+"-Price";
                }) 
            }
    
            tmpGraphNotesData.forEach(element => {
                let obj: any = {};
                obj.date = new Date(element.date);
                obj.graph = graphName.id;
                obj.type="sign",
                obj.text = element.indicator;
                obj.graphCategory = symbolName;
                obj.backgroundColor= "#FFFFFF";
                obj.backgroundAlpha= 0.5;
                tmpGraphNotesArr.push(obj);    
            });

           
            return tmpGraphNotesArr;
    }
    
    }
    checkExisitngEvents() {
        let existingEvent:any=[];
        let graphFound  ={};
        if(!this.integratedChartInstance) {
            existingEvent=[];
        }
        else {
            existingEvent= this.integratedChartInstance.dataSets[0].stockEvents;
        }
        
        let currentGraphName = this.graphName[this.graphName.length-1].key;
        let splitCurrentGraphName = currentGraphName.split("-");
        let priceGraph = splitCurrentGraphName[0]+"-"+splitCurrentGraphName[1]+"-"+splitCurrentGraphName[2]+"-Price";
        let volumeGraph = splitCurrentGraphName[0]+"-"+splitCurrentGraphName[1]+"-"+splitCurrentGraphName[2]+"-Volume";
        graphFound = existingEvent.find((ele)=>{
            return ele.graphCategory== priceGraph || ele.graphCategory== volumeGraph;
        })        
        return   (graphFound==undefined ? {} : graphFound);
    }
